## ListenerMixin

There's `ListenerMixin` for React which was not included:

```
var Status = React.createClass({
    mixins: [Reflux.ListenerMixin],
    onStatusChange: function(status) {
        this.setState({
            currentStatus: status
        });
    },
    componentDidMount: function() {
        this.listenTo(statusStore, this.onStatusChange);
    },
    render: function() {
        // render specifics
    }
});
```
## createAction

> Create an action by calling Reflux.createAction with an optional options object.

`options` in `createAction()` is optional. So it should be possible to do:

```
var myAction = Reflux.createAction();
```

Source: https://github.com/reflux/refluxjs/blob/master/README.md

case 2. Improvement to existing type definition.
- documentation: https://github.com/gsklee/ngStorage/blob/0.3.10/ngStorage.js
- it has been reviewed by a DefinitelyTyped member;

See #4094

It should be possible to call:

``` JavaScript
$('playlist').triggerHandler({type: 'load'});

$('input').triggerHandler({
    type: 'change',
    target: {
        files: [
            new Blob(['data0']),
            new Blob(['data1'])
        ]
    }
});
```

Definition: `triggerHandler(event: any): Object`
I could not find a way with TypeScript to force `event` to have at least property `type` :/

And also:

``` JavaScript
$('input').triggerHandler('input').triggerHandler('change');
```

`triggerHandler()` should return ~~`JQuery`~~ Object.
